import React, { FC } from 'react';
import { PcaWrapper } from './pca.styled';
import Pagination from 'react-bootstrap/Pagination';

interface CarProps {
   car: {
      comments: string[];
      digits: string;
      is_stolen: boolean;
      model: string;
      model_year: number;
      operations: Array<any>;
      photo_url: string;
      region: {
        name: string;
        name_ua: string;
        slug: string;
        old_code: string;
        new_code: string;
      };
      stolen_details: any;
      vendor: string;
      vin: string;
    } | null | string;
}

const Pca: FC<CarProps> = ({car}) => (
  <PcaWrapper>
      <Pagination>
      <Pagination.First />
      <Pagination.Prev />
      <Pagination.Item>{1}</Pagination.Item>
      <Pagination.Ellipsis />

      <Pagination.Item>{10}</Pagination.Item>
      <Pagination.Item>{11}</Pagination.Item>
      <Pagination.Item active>{12}</Pagination.Item>
      <Pagination.Item>{13}</Pagination.Item>
      <Pagination.Item disabled>{14}</Pagination.Item>

      <Pagination.Ellipsis />
      <Pagination.Item>{20}</Pagination.Item>
      <Pagination.Next />
      <Pagination.Last />
    </Pagination>
  </PcaWrapper>
);

export default Pca;
